import React from 'react';

interface BotProps {
    id: number;
    x: number;
    y: number;
    isClick: boolean;
};

const Bot: React.FC<BotProps> = ({ x, y, isClick, }) => {
    const style: React.CSSProperties = {
        left: `${x}px`,
        top: `${y}px`,
    };


    return (
        <div
            className={`cursor ${ isClick ? 'cursor--click' : ''}`}
            style={style}
        >
            <div class="cursor__anim"/>
        </div>
    )
};

export default Bot;
